import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { FaFacebook, FaInstagram, FaLinkedin } from 'react-icons/fa';

import './navbar.css';

const NavBarHarsh = () => {
  const [menuOpen, setMenuOpen] = useState(false);

  return (
    <div>
      <div className="hero-section">
        {/* Top Bar */}
        <header className="header">
          <div className="top-bar">
            <div className="social-icons">
              <div className="social-media-icons">
                <a href="https://www.facebook.com" target="_blank" rel="noopener noreferrer">
                  <FaFacebook size={30} />
                </a>
                &nbsp;&nbsp;&nbsp;
                <a href="https://www.instagram.com" target="_blank" rel="noopener noreferrer">
                  <FaInstagram size={30} />
                </a>
                &nbsp;&nbsp;&nbsp;
                <a href="https://www.linkedin.com" target="_blank" rel="noopener noreferrer">
                  <FaLinkedin size={30} />
                </a>
              </div>
            </div>
            <div className="contact">
              <span>&nbsp;&nbsp;&nbsp;&nbsp;9752881492</span>
              <span>&nbsp;&nbsp;infozaeeshcorporation@gmail.com</span>
            </div>
            <div className="contact-1">
              <span><Link to="/form/login">Login</Link> &nbsp;&nbsp;|</span>
              <span>&nbsp;&nbsp;<Link to="/form/signup">Sign-Up</Link></span>
            </div>
          </div>

          {/* Navbar */}
          <nav className="navbar">
            <div className="logo">
              {/* Add your logo here */}
            </div>
            <div className="menu-icon" onClick={() => setMenuOpen(!menuOpen)}>
              â˜°
            </div>
            <ul className={`nav-links ${menuOpen ? "show" : ""}`}>
              <li><Link to="/">HOME</Link></li>
              <li><Link to="/src/Pages/">SERVICES</Link></li>
              <li><Link to="/src/Pages/AboutPage.js">ABOUT US</Link></li>
              <li><Link to="/">GALLERY</Link></li>
              <li><Link to="/">PRIVACY & POLICY</Link></li>
              <li><Link to="/">CONTACT US</Link></li>
            </ul>
          </nav>
        </header>
      </div>

      {/* Main Content */}
      {/* <Footer /> */}
    </div>
  );
};

export default NavBarHarsh;
